import React from 'react'
import ReactDOM from 'react-dom'
import { Provider } from "react-redux";

import store from "./store";
import AppRouter from "./routers/AppRouter";

const App = () => {
  return (
    <Provider store={store}>
      <AppRouter />
    </Provider>
  );
};
export default App;
